const data={
  id:1,
  title:'Adhi nade',
  author:'Sachin Tendulkar',
  imgURL:'https://th.bing.com/th?id=ORMS.1d0172df3e14ec14245231424ae85f82&pid=Wdp&w=612&h=304&qlt=90&c=1&rs=1&dpr=1.25&p=0'
}


const App=()=>{
  return <>
    
    <Moive  key={data.id}
            author={data.author}
            title={data.title}
            imgURL={data.imgURL}
    />
    
  </>
    
 
}



const Moive=(props)=>{
  const {title, author,imgURL}=props;
  return (
    <div className="eachmoive">
    <p>{title}</p>
    <p>{author}</p>
    <img src={imgURL} alt="rgmlk"/>
  </div>
  );
  
}




export default App;
